import React from 'react';
import './Home.css';

function Home() {
  return (
    <section id="home" className="Home">
      <div className="hero">
        <h1 className="animate">Welcome to My Portfolio</h1>
        <p className="animate delay">Hi, I'm Uma. I'm a Full Stack Developer.</p>
      </div>
    </section>
  );
}

export default Home;
